import React, { useState, useContext } from "react";
import TeachersContext from "../context/TeachersContext";
import { makeStyles } from "@material-ui/core/styles";
import Button from "@material-ui/core/Button";
import { blue } from "@material-ui/core/colors";

const useStyles = makeStyles({
  avatar: {
    backgroundColor: blue[100],
    color: blue[600]
  }
});

const PayrollSheet = props => {
  const classes = useStyles();
  const { currentTeacher } = props;

  return (
    <Dialog onClose={false} aria-labelledby="payroll-sheet-dialog" open={true}>
      <DialogTitle id="payroll-sheet-dialog">
        Payroll for {currentTeacher}
      </DialogTitle>
      {currentTeacher}
    </Dialog>
  );
};
export default PayrollSheet;
